import React from 'react';
import { connect } from 'react-redux';
import Nav from './Nav';

const List = ({ state }) => {
  return (
    <main>
      <Nav />
      {console.log(state)}
    </main>
  )
}

function mapStateToProps({ state }) {
  return { state: { ...state } };
}

export default connect(mapStateToProps, null)(List);
